export default props => {
    return (
        <div>
            <div>
                Filho {props.quandoClicar.nome}
            </div>
            <button onClick={
                function (e) {
                    props.quandoClicar('João', 53, true)
                }
            }>Fornecer informações</button>
        </div>
    )
}
